import {BrowserRouter, Route,Routes } from "react-router-dom";
import homepage from "screens/homepage";

function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route >
          <Route path="/" element = {homepage}  ></Route>

        </Route>

      </Routes>
    </BrowserRouter>
  );
}

export default App;
